import org.junit.Assert;
import org.junit.Test;

public class Q00214hTest {

    Q00214h_Ans q00214h = new Q00214h_Ans();

    @Test
    public void shortestPalindrome() {
        Assert.assertEquals("bacabacab", q00214h.shortestPalindrome("abacab"));
        Assert.assertEquals("aaacecaaa", q00214h.shortestPalindrome("aacecaaa"));
        Assert.assertEquals("dcbabcd", q00214h.shortestPalindrome("abcd"));
        Assert.assertEquals("a", q00214h.shortestPalindrome("a"));
        Assert.assertEquals("aa", q00214h.shortestPalindrome("aa"));
        //Assert.assertEquals("", q00214h.shortestPalindrome(""));
    }
}